  false,\n\t\"url\": null,\n\t\"notes\": \"This project will identify, document and
  model important habitat in the Connecticut River Watershed (CRW) as part of a broader
  Conservation Design Pilot Project led by the NALCC. This project uses an SHC approach
  to: 1) Collaboratively prioritize places, strategies and actions to conserve ecosystems,
  fish, wildlife and plants within the CRW; and 2) Establish a process for landscape
  scale conservation design that can be applied elsewhere in the region. Nanotag technology
  allows for bird (surrogate species) recapture rates of over 90 percent. Capture
  and tagging 75 birds per season, over two consecutive years will allow for modeling
  of surrogate species movement and residence time in the CRW.  This report summarizes
  efforts done in 2015.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
